import React from 'react';
import Email from './email/email.component';

const EmailList = ({ emails }) => {
  return (
    <div className="email-list">
      {emails.map((email) => (
        <Email
          key={email.id}
          id={email.id}
          from={email.from}
          address={email.address}
          time={email.time}
          message={email.message}
          subject={email.subject}
          tag={email.tag}
          read={email.read}
        />
      ))}
    </div>
  );
};

export default EmailList;
